    "description.limitPerMinute": "\u0417\u0430\u043F\u0440\u043E\u0441\u044B, \u043F\u0440\u0435\u0432\u044B\u0448\u0430\u044E\u0449\u0438\u0435 \u044D\u0442\u043E\u0442 \u043B\u0438\u043C\u0438\u0442, \u043F\u043E\u043F\u0430\u0434\u0430\u044E\u0442 \u0432 \u043E\u0447\u0435\u0440\u0435\u0434\u044C \u0434\u043E \u043D\u0430\u0447\u0430\u043B\u0430 \u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0435\u0439 \u043C\u0438\u043D\u0443\u0442\u044B. \u0412 \u0441\u0432\u044F\u0437\u0438 \u0441 \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u043C\u0438 \u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0435\u043D\u0438\u044F\u043C\u0438 \u0442\u0435\u043A\u0443\u0449\u0435\u0433\u043E \u0441\u0435\u0440\u0432\u0438\u0441\u0430 OpenAI, \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0435 \u043F\u0440\u0435\u0434\u043B\u0430\u0433\u0430\u0435\u043C\u044B\u0435 \u0437\u043D\u0430\u0447\u0435\u043D\u0438\u044F \u043C\u043E\u0436\u043D\u043E \u043F\u043E\u0441\u043C\u043E\u0442\u0440\u0435\u0442\u044C <1>\u0437\u0434\u0435\u0441\u044C</1>",
    "description.limitPerSecond": "\u0417\u0430\u043F\u0440\u043E\u0441\u044B, \u043F\u0440\u0435\u0432\u044B\u0448\u0430\u044E\u0449\u0438\u0435 \u044D\u0442\u043E\u0442 \u043B\u0438\u043C\u0438\u0442, \u043F\u043E\u043F\u0430\u0434\u0430\u044E\u0442 \u0432 \u043E\u0447\u0435\u0440\u0435\u0434\u044C \u0434\u043E \u043D\u0430\u0447\u0430\u043B\u0430 \u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0435\u0439 \u0441\u0435\u043A\u0443\u043D\u0434\u044B. \u0412 \u0441\u0432\u044F\u0437\u0438 \u0441 \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u043C\u0438 \u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0435\u043D\u0438\u044F\u043C\u0438 \u0442\u0435\u043A\u0443\u0449\u0435\u0433\u043E \u0441\u0435\u0440\u0432\u0438\u0441\u0430 OpenAI, \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0435 \u043F\u0440\u0435\u0434\u043B\u0430\u0433\u0430\u0435\u043C\u044B\u0435 \u0437\u043D\u0430\u0447\u0435\u043D\u0438\u044F \u043C\u043E\u0436\u043D\u043E \u043F\u043E\u0441\u043C\u043E\u0442\u0440\u0435\u0442\u044C <1>\u0437\u0434\u0435\u0441\u044C</1>",
    "description.generalLimitPerSecond": "\u0417\u0430\u043F\u0440\u043E\u0441\u044B, \u043F\u0440\u0435\u0432\u044B\u0448\u0430\u044E\u0449\u0438\u0435 \u044D\u0442\u043E\u0442 \u043B\u0438\u043C\u0438\u0442, \u043F\u043E\u043F\u0430\u0434\u0430\u044E\u0442 \u0432 \u043E\u0447\u0435\u0440\u0435\u0434\u044C \u0434\u043E \u043D\u0430\u0447\u0430\u043B\u0430 \u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0435\u0439 \u0441\u0435\u043A\u0443\u043D\u0434\u044B.",
    "description.prompt": "\u041E\u0442\u043F\u0440\u0430\u0432\u0438\u0442\u044C \u0434\u0438\u0430\u043B\u043E\u0433 {service} \u043E\u0442 \u0438\u043C\u0435\u043D\u0438 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F, \u0433\u0434\u0435 {{text}} \u043E\u0431\u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442 \u0442\u0435\u043A\u0441\u0442 \u043F\u0430\u0440\u0430\u0433\u0440\u0430\u0444\u0430, {{from}} \u043E\u0431\u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442 \u044F\u0437\u044B\u043A \u043F\u0430\u0440\u0430\u0433\u0440\u0430\u0444\u0430, \u0430 {{to}} \u043E\u0431\u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442 \u0446\u0435\u043B\u0435\u0432\u043E\u0439 \u044F\u0437\u044B\u043A.",
    "description.maxTextLengthPerRequest": "\u041C\u0430\u043A\u0441\u0438\u043C\u0430\u043B\u044C\u043D\u043E\u0435 \u043A\u043E\u043B\u0438\u0447\u0435\u0441\u0442\u0432\u043E \u0441\u0438\u043C\u0432\u043E\u043B\u043E\u0432 \u0432 \u043E\u0434\u043D\u043E\u043C \u0437\u0430\u043F\u0440\u043E\u0441\u0435 \u0441\u043B\u0438\u0448\u043A\u043E\u043C \u0432\u0435\u043B\u0438\u043A\u043E, \u0447\u0442\u043E \u043F\u0440\u0438\u0432\u043E\u0434\u0438\u0442 \u043A \u043C\u0435\u0434\u043B\u0435\u043D\u043D\u043E\u043C\u0443 \u043E\u0442\u043A\u043B\u0438\u043A\u0443 \u0438\u043D\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0430, \u043F\u043E\u044D\u0442\u043E\u043C\u0443 \u043F\u043E\u043F\u0440\u043E\u0431\u0443\u0439\u0442\u0435 \u043E\u0442\u0440\u0435\u0433\u0443\u043B\u0438\u0440\u043E\u0432\u0430\u0442\u044C \u044D\u0442\u043E\u0442 \u043F\u0430\u0440\u0430\u043C\u0435\u0442\u0440 \u0434\u043B\u044F \u043E\u043F\u0442\u0438\u043C\u0438\u0437\u0430\u0446\u0438\u0438 \u0441\u043A\u043E\u0440\u043E\u0441\u0442\u0438 \u0440\u0430\u0431\u043E\u0442\u044B",
    "description.systemPrompt": "\u0414\u0438\u0430\u043B\u043E\u0433, \u043E\u0442\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u043D\u044B\u0439 \u0441\u0438\u0441\u0442\u0435\u043C\u043E\u0439 \u0432 {service}, \u0433\u0434\u0435 {{text}} \u043E\u0431\u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442 \u0442\u0435\u043A\u0441\u0442 \u043F\u0430\u0440\u0430\u0433\u0440\u0430\u0444\u0430, {{from}} \u043E\u0431\u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442 \u044F\u0437\u044B\u043A \u043F\u0430\u0440\u0430\u0433\u0440\u0430\u0444\u0430, {{to}} \u043E\u0431\u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442 \u0446\u0435\u043B\u0435\u0432\u043E\u0439 \u044F\u0437\u044B\u043A.",
    "field.domain": "\u0446\u0430\u0440\u0441\u0442\u0432\u043E",
