    "description.model": "\u041C\u043E\u0434\u0435\u043B\u0438 OpenAI, \u043C\u043E\u0433\u0443\u0442 \u0431\u044B\u0442\u044C gpt-3.5-turbo, gpt-4 \u0438 \u0442.\u0434.",
    "description.maxTextGroupLengthPerRequest": "\u041A\u043E\u043B\u0438\u0447\u0435\u0441\u0442\u0432\u043E \u0430\u0431\u0437\u0430\u0446\u0435\u0432, \u043F\u0435\u0440\u0435\u0434\u0430\u0432\u0430\u0435\u043C\u044B\u0445 \u0441\u043B\u0443\u0436\u0431\u0435 \u043F\u0435\u0440\u0435\u0432\u043E\u0434\u0430 \u0437\u0430 \u043E\u0434\u0438\u043D \u0440\u0430\u0437, \u0435\u0441\u043B\u0438 \u0438\u0445 \u0441\u043B\u0438\u0448\u043A\u043E\u043C \u043C\u043D\u043E\u0433\u043E, \u044D\u0442\u043E \u043C\u043E\u0436\u0435\u0442 \u043F\u0440\u0438\u0432\u0435\u0441\u0442\u0438 \u043A \u0437\u0430\u043C\u0435\u0434\u043B\u0435\u043D\u0438\u044E \u0440\u0435\u0430\u043A\u0446\u0438\u0438 \u0438\u043D\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0430",
