    currentPlanDescriptionForOneTime: "\u0421\u0440\u043E\u043A \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F \u0442\u0435\u043A\u0443\u0449\u0435\u0439 \u043F\u043E\u0434\u043F\u0438\u0441\u043A\u0438\uFF1A{plan}\u0438\u0441\u0442\u0435\u043A\u0430\u0435\u0442 \u043D\u0430 \u0441\u0430\u0439\u0442\u0435 {endAt} , <1>\u043D\u0430\u0436\u043C\u0438\u0442\u0435 \u0437\u0434\u0435\u0441\u044C, \u0447\u0442\u043E\u0431\u044B \u043F\u0435\u0440\u0435\u0439\u0442\u0438 \u043D\u0430 \u0433\u043E\u0434\u043E\u0432\u043E\u0435</1> \u0438\u043B\u0438 <2>\u0435\u0436\u0435\u043C\u0435\u0441\u044F\u0447\u043D\u043E\u0435</2> \u0447\u043B\u0435\u043D\u0441\u0442\u0432\u043E.",
