    modalEnableInputTranslationDesc: "\u0412\u044B \u0442\u043E\u043B\u044C\u043A\u043E \u0447\u0442\u043E \u0437\u0430\u043F\u0443\u0441\u0442\u0438\u043B\u0438 \u0444\u0443\u043D\u043A\u0446\u0438\u044E \u043F\u0435\u0440\u0435\u0432\u043E\u0434\u0430 \u043F\u043E\u043B\u044F \u0432\u0432\u043E\u0434\u0430 Immersive Translation, \u043D\u0430\u0436\u0430\u0432 3 \u0440\u0430\u0437\u0430 \u043F\u043E\u0434\u0440\u044F\u0434 \u043A\u043B\u0430\u0432\u0438\u0448\u0443 \u043F\u0440\u043E\u0431\u0435\u043B\u0430, \u0438 \u0441\u043E\u0434\u0435\u0440\u0436\u0438\u043C\u043E\u0435 \u043F\u043E\u043B\u044F \u0432\u0432\u043E\u0434\u0430 \u0431\u0443\u0434\u0435\u0442 \u043F\u0435\u0440\u0435\u0432\u0435\u0434\u0435\u043D\u043E \u043D\u0430 \u0446\u0435\u043B\u0435\u0432\u043E\u0439 \u044F\u0437\u044B\u043A \u043F\u043E \u0443\u043C\u043E\u043B\u0447\u0430\u043D\u0438\u044E. \u041F\u0435\u0440\u0435\u0432\u043E\u0434 \u043C\u043E\u0436\u043D\u043E \u043E\u0442\u043C\u0435\u043D\u0438\u0442\u044C \u0441 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u043A\u043B\u0430\u0432\u0438\u0448 Ctrl+Z.<br /><br />\u0415\u0441\u043B\u0438 \u044D\u0442\u043E \u0431\u044B\u043B\u0430 \u043E\u0448\u0438\u0431\u043A\u0430, \u043D\u0435 \u0432\u043E\u043B\u043D\u0443\u0439\u0442\u0435\u0441\u044C, \u0432\u044B \u043C\u043E\u0436\u0435\u0442\u0435 \u043E\u0442\u043A\u043B\u044E\u0447\u0438\u0442\u044C \u0435\u0435 \u043D\u0430 \u044D\u0442\u043E\u0442 \u0440\u0430\u0437 \u0438\u043B\u0438 \u043D\u0430\u0432\u0441\u0435\u0433\u0434\u0430 \u043E\u0442\u043A\u043B\u044E\u0447\u0438\u0442\u044C \u043F\u0435\u0440\u0435\u0432\u043E\u0434 \u043F\u043E\u043B\u044F \u0432\u0432\u043E\u0434\u0430.",
