    "desc.touchShortcutsToggleTranslatePageOnlyTranslation": "\u0422\u043E\u043B\u044C\u043A\u043E \u043F\u0435\u0440\u0435\u0432\u043E\u0434 \u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442, \u0447\u0442\u043E \u043E\u0442\u043E\u0431\u0440\u0430\u0436\u0430\u0435\u0442\u0441\u044F \u0442\u043E\u043B\u044C\u043A\u043E \u043F\u0435\u0440\u0435\u0432\u043E\u0434. \u0415\u0441\u043B\u0438 \u0441\u0442\u0440\u0430\u043D\u0438\u0446\u0430 \u0435\u0449\u0435 \u043D\u0435 \u043F\u0435\u0440\u0435\u0432\u0435\u0434\u0435\u043D\u0430, \u043E\u043D\u0430 \u043F\u0435\u0440\u0435\u043A\u043B\u044E\u0447\u0438\u0442\u0441\u044F \u0432 \u0440\u0435\u0436\u0438\u043C \u0438 \u0431\u0443\u0434\u0435\u0442 \u043F\u0435\u0440\u0435\u0432\u0435\u0434\u0435\u043D\u0430.",
    "desc.toggleOnlyTransation": '\u0420\u0435\u0436\u0438\u043C "\u0422\u043E\u043B\u044C\u043A\u043E \u043F\u0435\u0440\u0435\u0432\u043E\u0434" \u043E\u0437\u043D\u0430\u0447\u0430\u0435\u0442, \u0447\u0442\u043E \u043E\u0442\u043E\u0431\u0440\u0430\u0436\u0430\u0435\u0442\u0441\u044F \u0442\u043E\u043B\u044C\u043A\u043E \u043F\u0435\u0440\u0435\u0432\u043E\u0434. \u0415\u0441\u043B\u0438 \u0441\u0442\u0440\u0430\u043D\u0438\u0446\u0430 \u0435\u0449\u0435 \u043D\u0435 \u043F\u0435\u0440\u0435\u0432\u0435\u0434\u0435\u043D\u0430, \u0440\u0435\u0436\u0438\u043C \u0431\u0443\u0434\u0435\u0442 \u043F\u0435\u0440\u0435\u043A\u043B\u044E\u0447\u0435\u043D \u0438 \u0432\u044B\u043F\u043E\u043B\u043D\u0435\u043D \u043F\u0435\u0440\u0435\u0432\u043E\u0434.',
    touchShortcutsToggleTranslatePageOnlyTranslation: "\u041D\u0430\u0441\u0442\u0440\u043E\u0439\u043A\u0430 \u0436\u0435\u0441\u0442\u043E\u0432 \u0441\u0435\u043D\u0441\u043E\u0440\u043D\u043E\u0433\u043E \u044D\u043A\u0440\u0430\u043D\u0430 \u0434\u043B\u044F \u043F\u0435\u0440\u0435\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u044F \u043C\u0435\u0436\u0434\u0443 \u0434\u0432\u0443\u044F\u0437\u044B\u0447\u043D\u044B\u043C / \u0442\u043E\u043B\u044C\u043A\u043E \u0442\u0435\u043A\u0441\u0442\u043E\u043C \u043F\u0435\u0440\u0435\u0432\u043E\u0434\u0430",
    download_started: "\u0417\u0430\u0433\u0440\u0443\u0437\u043A\u0430 \u0443\u0436\u0435 \u043D\u0430\u0447\u0430\u043B\u0430\u0441\u044C, \u0435\u0441\u043B\u0438 \u043E\u043D\u0430 \u043D\u0435 \u043D\u0430\u0447\u0430\u043B\u0430\u0441\u044C \u0430\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438, \u043F\u043E\u0436\u0430\u043B\u0443\u0439\u0441\u0442\u0430, \u043D\u0430\u0436\u043C\u0438\u0442\u0435 \u0432\u0440\u0443\u0447\u043D\u0443\u044E.",
    here: "\u0437\u0434\u0435\u0441\u044C",
    "error.goReset": "\u0441\u0431\u0440\u043E\u0441\u0438\u0442\u044C",
    batchEdit: "\u041C\u0430\u0441\u0441\u043E\u0432\u0430\u044F \u043E\u043F\u0435\u0440\u0430\u0446\u0438\u044F",
    "error.configError": "\u041D\u0430\u0441\u0442\u0440\u043E\u0439\u043A\u0430 \u0434\u0430\u043D\u043D\u044B\u0445 \u0430\u043D\u043E\u043C\u0430\u043B\u044C\u043D\u0430",
    "translationFont.custom": "\u0412\u0432\u0435\u0434\u0438\u0442\u0435 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u043A\u0438\u0439 \u0448\u0440\u0438\u0444\u0442",
    translationFont: "\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u0438\u0442\u044C \u0448\u0440\u0438\u0444\u0442",
    detectServiceLoading: "\u041F\u0440\u043E\u0432\u0435\u0440\u043A\u0430 \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u0445 \u043F\u0435\u0440\u0435\u0432\u043E\u0434\u0447\u0435\u0441\u043A\u0438\u0445 \u0443\u0441\u043B\u0443\u0433...",
